import { useListView } from "../../hooks/listView/useListView";

export const ListView = ({ user, date, setDate }) => {
  const {
    isListViewLoading,
    startDate,
    listView,
    onAddBtnClick,
    onSubtractBtnClick,
  } = useListView(user, date, setDate);
  return <ol></ol>;
  return <h2> List View </h2>;
  // startDate 바꾸기
  // date 바꾸기 (setDate 상위 state의)
  // refresh 하기
};
